//Random number functions////////////////////

//This function applies the Box-Muller Method - this routine generates two uniform random numbers and calculates only one of the random-normal numbers

double getRandomNormal(double mu, double sigma)
{
    double pi = -acos(-1.0);
    
    double U, V;
    
    double Random_normal;
    
    U = double(rand())/double(RAND_MAX);
    V = double(rand())/double(RAND_MAX);
    
    Random_normal =  ( ( sqrt(-2.0*log(U))*cos(2*pi*V) ) * sigma ) + mu;
    
    return Random_normal;
}

double getRandomLinear(double Min, double Max)
{
    double value;
    
    value = Min + ( double(rand())/double(RAND_MAX) ) * (Max - Min);
    
    return value;
}

double getRandomLinear2(double Min, double Max, int seed)
{
    double value;
    
    std::minstd_rand0 generator (seed);
    
    value = Min + ( double(generator())/(double(generator.max())-double(generator.min() ) +1.0  ) ) * (Max - Min);
    
    //cout << generator() << '\t' << generator.max() << '\t' << generator.min() << '\t' << value << endl;
    
    return value;
}



//The terrestrial system functions
double getdCvdt(double pCO2, double pCO2init, double DeltaTemp, double Cv, double Cv0, double NPP0, double gamma, double dNPPdT)
{
    
    double dCvdt;
    
    //Alternatively could do with half saturation coefficients
    //double kc=29.0; //in ppm
    //double km=145.0; //in ppm
    
    
    
    
    
    double f1, f2;
    
    f1 = 1.0 + (dNPPdT/NPP0)*DeltaTemp;
    
    //f2 = ( (pCO2 - kc)/(km + pCO2 - kc) ) / ( (pCO2init - kc)/(km + pCO2init - kc) );
    
    f2 = 1.0 + gamma*log(pCO2/pCO2init);
    
    dCvdt = NPP0*f1*f2 - NPP0*(Cv/Cv0);
    
    return dCvdt;
    
    
}

double getdCsdt(double Cv, double Cv0, double Cs, double Cs0, double NPP0, double DeltaTemp, double dtaudT)
{
    double dCsdt;
    double f3;
    
    
    f3 = (Cs0/NPP0) / ( (Cs0/NPP0) + (dtaudT*DeltaTemp) );
    
    dCsdt = ( NPP0 * (Cv/Cv0) ) - ( NPP0 * (Cs/Cs0) * f3 );
    
    return dCsdt;
    
    
}

