void convertI_em(int t_steps_year) //converts emission scenarios when more than 1 time step per year
{
    //First set a dummy array equal to I_em;
    double I_em_dummy[tmax];
    for (int i = 0; i<tmax; i++)
    {
        I_em_dummy[i] = I_em[i];
    }
    //Now re-set original Iem array by linearising between years
    
    int years=0;
    int count = 0;
    double annual_em;
    for(int i=0; i<tmax; i++)
    {
        annual_em = I_em_dummy[years+1]-I_em_dummy[years]; //set annual emission rate
        
        I_em[i] = I_em_dummy[years] + double(count)*annual_em/double(t_steps_year);
        
        count++;
        
        if(count == (t_steps_year))
        {
            count=0;
            years++;
        }
        
        
    }
    
    
}

