double getRateINDCs(double yearEm)//Fawcett et al (2015) analysis of CO2 emissions from INDC
{
    double EmRate2030= 10.67 + 0.96; //Fawcett et al (2015) + constant 2014 land use change contribution which is average 2010-2014 from Carbon Budget 2015.
    
    double EmRate2014= 9.80+1.09;
    
    double RateEm = 0.0; //is in PgC yr-1
    
    if(yearEm < 2014.0)
    {
        yearEm = 2014.0;
    }
    
    if(yearEm <= 2031.0) //Linear increase to 2030
    {
        RateEm =  EmRate2014 + (EmRate2030-EmRate2014)* ( (yearEm - 2014.0)/(2031.0-2014.0) );
    }
    if(yearEm > 2031.0) //Constant after 2030.
    {
        RateEm = EmRate2030;
    }
    
    return RateEm;
    
}


//Function returns the annual emission rate from The Carbon Budget 2015, LeQuere et al (2015).
double getRateCarbonBudget(double yearEm)
{
    double RateEm=0.0; //is in PgC per year
    
    if(yearEm<2006.0)
    {
        RateEm = 8.08+1.02;
    }
    if(yearEm>=2006.0 && yearEm <2007.0)
    {
        RateEm = 6.36+1.09;
    }
    if(yearEm>=2007.0 && yearEm <2008.0)
    {
        RateEm = 8.53+0.97;
    }
    if(yearEm>=2008.0 && yearEm <2009.0)
    {
        RateEm = 8.74+0.67;
    }
    if(yearEm>=2009.0 && yearEm <2010.0)
    {
        RateEm = 8.70+0.76;
    }
    if(yearEm>=2010.0 && yearEm <2011.0)
    {
        RateEm = 9.14+0.88;
    }
    if(yearEm>=2011.0 && yearEm <2012.0)
    {
        RateEm = 9.45+0.91;
    }
    if(yearEm>=2012.0 && yearEm <2013.0)
    {
        RateEm = 9.58+0.97;
    }
    if(yearEm>=2013.0 && yearEm <2014.0)
    {
        RateEm = 9.74+0.92;
    }
    if(yearEm>=2014.0)
    {
        RateEm = 9.80+1.09;
    }
    return RateEm;
}

